import Link from 'next/link';
import Layout from '../src/components/Layout';

const PostLink = props => (
    <li>
        <Link href={`/post?title=${props.title}`}>
            <a>{props.title}</a>
        </Link>
    </li>
)

function Blogs() {
    return (
      <Layout>
        
        <p>BLOGS</p>

        <ul>
            <PostLink />
        </ul>
      </Layout>
    );
  }

  export default Blogs;
